	('04a553a4-994a-4c64-8128-fe572d72194a', 'Mengenali Bahasa Isyarat Malaysia', 'Bahasa isyarat ini ialah bahasa yang tulen bagi orang kehilangan pendengaran di Malaysia, yang juga merupakan bahasa ibunda dan bahasa isyarat istimewa bagi Orang Pekak Malaysia.

Pada awalnya mereka menggunakan ASL (American Sign Language), kemudian telah diadaptasi agar sesuai digunakan di Malaysia.

Bahasa isyarat ini mempunyai tatabahasa yang tersendiri yang mana ianya lebih menjurus kepada apa yang boleh dilihat oleh orang pekak itu sendiri.

Tidak dinafikan bahawa bahasa ini ini tidak sesuai dalam proses pembelajaran dan pengajaran bahasa samada Bahasa Inggeris mahupun Bahasa Melayu.

Walaubagaimanpun, penggunaan bahasa isyarat ini amat berguna untuk memudahkan pemahan orang pekak.

Pembangunan bahasa isyarat ini dibuat oleh Persekutuan Orang Pekak Malaysia sejak tahun 1997 melalui dana dari Abilis Foundation, Finland.

Persekutuan ini telah memulakan projek menghimpunan isyarat tempatan yang digunakan oleh orang Pekak dari pelbagai bangsa dan agama dari seluruh negara.

Bahasa isyarat ini kemudiannya telah diiktiraf sebagai bahasa rasmi orang Pekak di Malaysia melalui Akta Orang Kurang Upaya 2008 atau Akta 685.', 'f3ef37a5-299a-4a80-87d2-949c55d6fbea', '2025-06-17 04:19:26.941651+00', '2025-06-17 04:19:26.941651+00'),
	('b1b146a9-069e-4d47-9ec2-c269b6125c9b', 'Kelebihan Berkomunikasi Bahasa Isyarat', '> Dapat mengelakkan risiko perkembangan bahasa yang lambat bagi kanak-kanak pekak dan bisu. Masalah utama kanak-kanak masalah pendengaran ialah perkembamgan proses menguasai bahasa yang digunakan untuk berkomunikasi.

> Dapat mengembangkan keupayaan mental.

> Bahasa Isyarat banyak memberi sumbangan kepada perkembangan bayi. Antaranya bayi kurang mengalami tekanan dan dapat mengekspresikan perasaan dan kehendak mereka dengan menggunakan bahasa isyarat ketika mereka tidak tahu bercakap.

> Dapat menguasai kebolehan membaca dengan cepat.

JOM BELAJAR BAHASA ISYARAT', 'f3ef37a5-299a-4a80-87d2-949c55d6fbea', '2025-06-17 04:20:39.072768+00', '2025-06-17 04:20:39.072768+00'),
